You first need to build all of toxcore's dependencies: sodium, vpx and opus and then build toxcore linking it to those. You cross-compile those as usually, using the NDK toolchain, but vpx requires some non-standard arguments so check its README. It's a bit too much to explain it all in here...

@iphydf is saying he got some makefiles somewhere, I think he talks about [the Java toxcore bindings](https://github.com/TokTok/jvm-toxcore-c/tree/master/scripts), it supposedly automates everything for you or close to it, so it should be easier to use, you could give that a try. (There is also [an example echo bot written in Java](https://github.com/TokTok/echobot-jvm/blob/master/src/main/java/im/tox/echobot/EchoBot.java) that uses the bindings).

Jenkins is up for me.
